import React from "react";
import Epoch from "./Epoch";


function Home(){
    return (
      <div>
        <Epoch />
        <div style="width:100%;height:0;padding-bottom:100%;position:relative;">
          <iframe
            src="https://giphy.com/embed/eljCVpMrhepUSgZaVP"
            width="100%"
            height="100%"
            style="position:absolute"
            frameBorder="0"
            class="giphy-embed"
            allowFullScreen
          ></iframe>
        </div>
        <p>
          <a href="https://giphy.com/gifs/blue-white-brain-eljCVpMrhepUSgZaVP">
            via GIPHY
          </a>
        </p>
      </div>
    );
}

export default Home;
